data._contention:
Exemples:

Le sujet et l'objet ont un niveau de pouvoir et d'autorité similaire: &quot;Le mari aime la femme.&quot;
Il n'y a pas d'évidence que le mari ou la femme soit plus puissant (la phrase pourrait être reformulée en &quot;Le mari et la femme s'aiment&quot; sans que la dynamique change).
